import React, { useRef, useEffect, useState } from 'react';
import Header from '../components/Header';
import Message from '../components/Message';
import ChatInput from '../components/ChatInput';
import ErrorAlert from '../components/ErrorAlert';
import LoadingSpinner from '../components/LoadingSpinner';
import TypingIndicator from '../components/TypingIndicator';
import GeminiSettings from '../components/GeminiSettings';
import useChat from '../hooks/useChat';
import { useGemini } from '../hooks/useGemini';
import { KeyIcon, SparklesIcon } from '@heroicons/react/24/outline';

const Chat: React.FC = () => {
  const { messages, isLoading, isTyping, error, sendMessage } = useChat();
  const { apiKey, isValidKey } = useGemini();
  const [showError, setShowError] = useState<boolean>(!!error);
  const [showApiSettings, setShowApiSettings] = useState<boolean>(false);
  const messagesEndRef = useRef<HTMLDivElement>(null);

  // Scroll to bottom when messages change
  useEffect(() => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages, isTyping]);

  // Show error when error state changes
  useEffect(() => {
    setShowError(!!error);
  }, [error]);

  // Check if API key is set on first load
  useEffect(() => {
    // Don't show API settings dialog if we have an environment API key
    if (!apiKey && !isLoading && !process.env.REACT_APP_GEMINI_API_KEY) {
      setShowApiSettings(true);
    }
  }, [apiKey, isLoading]);

  return (
    <div className="min-h-screen flex flex-col bg-gray-50 dark:bg-dark-800 transition-colors duration-200">
      <Header />
      <div className="flex-1 overflow-hidden flex flex-col max-w-5xl w-full mx-auto">
        <div className="p-4 bg-white shadow-sm dark:bg-dark-700 dark:text-white transition-colors duration-200">
          <div className="flex items-center justify-between">
            <h1 className="text-xl font-bold text-gray-800 dark:text-white flex items-center gap-2">
              <SparklesIcon className={`h-5 w-5 ${isValidKey ? 'text-green-500' : 'text-gray-400'}`} />
              Google Gemini Chat Assistant
            </h1>
            
            <div className="flex items-center gap-2">
              {apiKey && (
                <span className={`text-xs px-2 py-1 rounded-full ${isValidKey ? 'bg-green-100 text-green-800 dark:bg-green-900/30 dark:text-green-300' : 'bg-yellow-100 text-yellow-800 dark:bg-yellow-900/30 dark:text-yellow-300'}`}>
                  {isValidKey ? 'Gemini Enabled' : 'Gemini Disabled'}
                </span>
              )}
              
              <button 
                onClick={() => setShowApiSettings(true)}
                className="p-1.5 text-gray-500 hover:text-gray-700 dark:text-gray-400 dark:hover:text-gray-300 rounded-full hover:bg-gray-100 dark:hover:bg-dark-600"
                aria-label="Gemini API Settings"
              >
                <KeyIcon className="h-5 w-5" />
              </button>
            </div>
          </div>
        </div>
        
        <div className="flex-1 overflow-y-auto p-4">
          {showError && error && (
            <ErrorAlert 
              message={error} 
              onDismiss={() => setShowError(false)} 
            />
          )}
          
          {messages.length === 0 ? (
            <div className="h-full flex flex-col items-center justify-center text-center p-6">
              <div className="max-w-md space-y-4">
                <SparklesIcon className="h-12 w-12 text-primary-500 mx-auto mb-2" />
                <h2 className="text-2xl font-bold text-gray-800 dark:text-white">Welcome to Gemini Chat</h2>
                <p className="text-gray-600 dark:text-gray-300">
                  This AI assistant is powered by Google's Gemini AI model.
                </p>
                <p className="text-gray-500 dark:text-gray-400 text-sm">
                  Start a conversation by typing a message below.
                </p>
              </div>
            </div>
          ) : (
            <>
              {isLoading && messages.length === 0 ? (
                <div className="h-full flex flex-col items-center justify-center">
                  <LoadingSpinner />
                  <p className="mt-4 text-gray-500 dark:text-gray-400">Loading conversation...</p>
                </div>
              ) : (
                <div className="space-y-4 pb-2">
                  {messages.map((message) => (
                    <Message
                      key={message.id}
                      content={message.content}
                      timestamp={message.timestamp}
                      isUser={message.isUser}
                    />
                  ))}
                  {isTyping && <TypingIndicator />}
                  <div ref={messagesEndRef} />
                </div>
              )}
            </>
          )}
        </div>
        
        <div className="mt-auto border-t border-gray-200 dark:border-dark-600">
          <ChatInput onSendMessage={sendMessage} disabled={isLoading || isTyping} />
        </div>
      </div>
      
      {showApiSettings && <GeminiSettings onClose={() => setShowApiSettings(false)} />}
    </div>
  );
};

export default Chat;
